import torch
#Tensor is multidimensional matrix, autograd is module for automatic differentiation
from torch import Tensor, nn, autograd

# Class which define custom forward and backward passes
class XORFunction(autograd.Function):
    @staticmethod
    def forward(ctx, X, weight, bias, bool_bprop):
    # X shape: (batch_size, in_features), weight shape: (out_features, in_features), bool_bprop is flag
    # For XOR operation between X and Weight, they have to be of the same dimension
    # X.int() converts X into integers because XOR operations work on integer values.
    # unsqueeze(dim) adds a new dimension (or axis) to a tensor at a specified position,
    # which is necessary to make two tensors compatible for operations like broadcasting.
    # XOR operation can be applied element-wise across the tensors.
    # After XORing, output is converted back to floating-point values for further operations.
        output = torch.bitwise_xor(X.int().unsqueeze(1), weight.int().unsqueeze(0)).float()

        # Since output will be (batch_size, out_features, in_features), we need to reduce it
        # Sum across in_features to get final output shape
        output = output.sum(dim=2)

        # Add bias if bias is present
        if bias is not None:
            output += bias

        # The input data X, weight, and bias are saved in the context (ctx) so that they
        # can be reused during backpropagation (when calculating gradients).
        ctx.save_for_backward(X, weight, bias)
        # Store bool_bprop flag for backward pass, it will help to compute gradient
        ctx.bool_bprop = bool_bprop

        return output

@staticmethod
#grad_output: This is the gradient of the loss with respect to the output of this layer.
def backward(ctx, grad_output):

        #Retrieve saved tensors and flag
        X, weight, bias = ctx.saved_tensors
        bool_bprop = ctx.bool_bprop

        # initialize gradients for the input X, the weights, and the bias.
        # grad_X: The gradient of the loss with respect to the input X.
        # grad_weight: The gradient of the loss with respect to the weights.
        # grad_bias: If bias exists, we calculate its gradient by summing the gradients of the output.
        grad_X = grad_output.clone()
        grad_weight = grad_output.clone()
        grad_bias = grad_output.sum() if bias is not None else None

        # IIf the bool_bprop flag is True, we apply a special rule for computing gradients: we simply take the sign of the gradients.
        if bool_bprop:
            grad_X = torch.sign(grad_X)
            grad_weight = torch.sign(grad_weight)

        return grad_X, grad_weight, grad_bias, None

# This defines a custom neural network layer that performs XOR operations instead of the traditional matrix multiplication.
class XORLinear(nn.Linear):

    def __init__(self, in_features: int, out_features: int, bool_bprop: bool, **kwargs):
       #super(): Calls the parent class (nn.Linear) constructor to inherit other layer functionalities.
       # reset_parameters(): Initializes random binary weights and biases (values of 0 or 1).
        super(XORLinear, self).__init__(in_features, out_features, **kwargs)
        self.bool_bprop = bool_bprop
        self.reset_parameters()

    def reset_parameters(self):
        # Binary weights and biases (random integers 0 or 1)
        # out_features: Number of neurons (outputs).
        # in_features: Number of input features (inputs to the layer).
        self.weight = nn.Parameter(torch.randint(0, 2, (self.out_features, self.in_features)).float())
        if self.bias is not None:
            self.bias = nn.Parameter(torch.randint(0, 2, (self.out_features,)).float())

       #In PyTorch, the forward() method defines what happens when data passes through a layer.
    def forward(self, X):
        # Here I am recalling the XORFuntion defined before
        return XORFunction.apply(X, self.weight, self.bias, self.bool_bprop)

#the XORFunction takes the input X and performs an XOR operation with the layer's weights,
#treating each element one by one. This means each input value is combined with its corresponding weight using the XOR rule.
# If there’s a bias, it gets added afterward. This way, the layer changes the input data based on XOR logic instead of the usual multiplication,
# making it act differently from standard neural network layers.

