    # Create an instance of the XORLinear layer, process input data using the custom XOR logic defined in its forward() method.
    xor_layer = XORLinear(in_features=in_features, out_features=out_features, bool_bprop=bool_bprop)

    # Create some random input data (for testing), in the end converting to float() to make it comaptible for NN
