"""# Algorithm 5: Python code of thebackpropagation logic of XOR linearlayer

![Screenshot 2024-10-06 150606.png](data:image/png;base64,)

- When we define a custom layer using XORLinear in Algorithm 4, the actual XOR operation for the forward pass happens inside the XORFunction's forward method from Algorithm 5. Basically, Algorithm 5 is the mathematical engine that powers the XOR operations in Algorithm 4

- Algorithm 5 implements the core XOR logic for both the forward and backward passes, and this is used by the XORLinear layer in Algorithm 4.
"""

import torch
from torch.autograd import Function
import torch.nn as nn

# This is the heart of the algorithm, where we define a custom operation using XOR
# logic for both the forward pass (prediction) and backward pass (gradient computation)
class XORFunction(Function):
#@staticmethod: Marks the function as a static method, meaning it doesn’t depend on an instance of the class but just the inputs.
    @staticmethod
    def forward(ctx, X, W, B, bool_bprop: bool):
        # Save variables so they can be used later during the backpropagation phase.
        ctx.save_for_backward(X, W, B)
        ctx.bool_bprop = bool_bprop

        S = torch.logical_xor(X[:, None, :], W[None, :, :])
        S = S.sum(dim=2).float() + B
        S = S - W.shape[1] / 2

        return S

#The backward method is automatically called during backpropagation when gradients are being computed.
@staticmethod
def backward(ctx, grad_output):
        X, W, B = ctx.saved_tensors

#If bool_bprop is true we use Binary approach otherwise regular Neural Network approach
        if ctx.bool_bprop:
            grad_X, grad_W, grad_B = backward_bool(ctx, grad_output)

        else:
            grad_X, grad_W, grad_B = backward_real(ctx, grad_output)

        return grad_X, grad_W, grad_B, None

# Helper functions for the backward pass (you can expand on these)
def backward_bool(ctx, grad_output):
    X, W, B = ctx.saved_tensors
    grad_X = torch.zeros_like(X)
    grad_W = torch.zeros_like(W)
    grad_B = grad_output.sum(dim=0)

    return grad_X, grad_W, grad_B

def backward_real(ctx, grad_output):
    X, W, B = ctx.saved_tensors
    grad_X = grad_output @ W.float()  # Gradient wrt input
    grad_W = grad_output.T @ X.float()  # Gradient wrt weights
    grad_B = grad_output.sum(dim=0)  # Gradient wrt bias

    return grad_X, grad_W, grad_B

"""- The backward_bool function computes gradients for the XOR layer but currently initializes the gradients for inputs and weights to zero, as XOR operations lack well-defined gradients. It only calculates the bias gradient by summing incoming gradients across the batch, acting as a placeholder for future custom XOR gradient logic.

- The backward_real function implements standard backpropagation for continuous inputs, calculating gradients for inputs, weights, and biases based on the output error. It uses the chain rule and the derivative of the activation function, providing a complete gradient calculation for effective parameter updates during training.
"""

# This is the custom layer that uses the XOR logic instead of regular matrix multiplication.
class XORLinear(nn.Module):
    def __init__(self, in_features, out_features, bool_bprop=True):
        super(XORLinear, self).__init__()
        self.in_features = in_features
        self.out_features = out_features
        self.bool_bprop = bool_bprop

        # Initialize the weights and bias randomly (binary)
        self.weight = nn.Parameter(torch.randint(0, 2, (out_features, in_features)).float())
        self.bias = nn.Parameter(torch.randint(0, 2, (out_features,)).float())

    def forward(self, X):
        return XORFunction.apply(X, self.weight, self.bias, self.bool_bprop)

if __name__ == "__main__":
    in_features = 3
    out_features = 2
    bool_bprop = True

    # instance of XORLinear
    xor_layer = XORLinear(in_features=in_features, out_features=out_features, bool_bprop=bool_bprop)

    # random input data (binary, 0 or 1)
    input_data = torch.randint(0, 2, (5, in_features)).float()  # Batch of 5 inputs

    # forward pass through the XORLinear layer
    output_data = xor_layer(input_data)

    # Print the input and output
    print("Input Data:")
