import torch
from torch.autograd import Function

class XORFunction(Function):

    @staticmethod
    def forward(ctx, X, W, B, bool_bprop):
        ctx.save_for_backward(X, W, B)
        ctx.bool_bprop = bool_bprop

        S = torch.logical_xor(X[:, None, :], W[None, :, :]).float()
        S = S.sum(dim=2) + B
        S = S - W.shape[1] / 2  #Optional

        return S

@staticmethod
def backward(ctx, Z):
        X, W, B = ctx.saved_tensors

        # It will progress only if the condition is true
        if ctx.bool_bprop:

            # Computing gradient and broadcasting for both W and X
            G_X = torch.logical_xor(Z[:, None, :], W[None, :, :]).float()
            G_X = 2 * G_X.sum(dim=1) - W.shape[0]

            G_W = torch.logical_xor(Z[:, :, None], X[:, None, :]).float()
            G_W = 2 * G_W.sum(dim=0) - X.shape[0]

            # sum over batch
            G_B = Z.sum(dim=0) if B is not None else None

        else:
            # For real valued its set to 0
            G_X, G_W, G_B = None, None, None

        return G_X, G_W, G_B

