"""#Algorithm 7: Backpropagation logic with real received backpropagation

![algo 7.png](data:image/png;base64,)
"""

import torch
from torch.autograd import Function
import torch.nn as nn

class XORFunction(Function):
    @staticmethod
    def forward(ctx, X, W, B):
        ctx.save_for_backward(X, W, B)

        output = torch.logical_xor(X[:, None, :].bool(), W[None, :, :].bool()).float()
        output = output.sum(dim=2) + B

        output = output - W.shape[1] / 2

        return output

@staticmethod
def backward(ctx, Z):
        X, W, B = ctx.saved_tensors

        G_X = Z.mm(1 - 2 * W)  # Gradient with respect to input (X)
        G_W = Z.t().mm(1 - 2 * X)  # Gradient with respect to weight (W)

        G_B = Z.sum(dim=0) if B is not None else None

        return G_X, G_W, G_B

class XORLinear(nn.Module):
    def __init__(self, in_features, out_features, use_bias=True):
        super(XORLinear, self).__init__()
        self.in_features = in_features
        self.out_features = out_features

        #Weight initialization
        self.weight = nn.Parameter(torch.randint(0, 2, (out_features, in_features)).float())
        self.bias = nn.Parameter(torch.randint(0, 2, (out_features,)).float()) if use_bias else None

    def forward(self, X):
        return XORFunction.apply(X, self.weight, self.bias)

if __name__ == "__main__":
    in_features = 3
    out_features = 2

    xor_layer = XORLinear(in_features, out_features, use_bias=True)
    input_data = torch.randint(0, 2, (5, in_features)).float()  # Batch of 5
    output_data = xor_layer(input_data)

    print("Input Data:")
    print(input_data)
    print("\nOutput Data:")
    print(output_data)

"""# Algorithm 8:Python code of Boolean optimizer

![algo 8.png](data:image/png;base64,)

- The BooleanOptimizer is an optimizer that operates on binary weights. In contrast to traditional optimizers (like SGD or Adam), which update floating-point weights using small increments, this optimizer works with weights that are binary (0 or 1). The idea is to “flip” the bits (from 0 to 1 or from 1 to 0) based on the accumulated gradients over time.

- We are using Boolean DL becasue of hardware implementations, reduce memory usage and computation cost.
"""

import torch
from torch.optim import Optimizer

#inheriting optimizer class from pyotrch, and defining parameters
class BooleanOptimizer(Optimizer):
    def __init__(self, params, lr: float):
        super(BooleanOptimizer, self).__init__(params, dict(lr=lr))

        # Initialize accumulators and ratios for each parameter group
        for param_group in self.param_groups:
            param_group['accums'] = [torch.zeros_like(p.data) for p in param_group['params']]
            param_group['ratios'] = [0 for p in param_group['params']]

# Accumulators store the running sum of gradients over time, which allows the optimizer to
# decide when to flip a bit based on the overall gradient history. Flipping a bit too early
# (based on a single gradient step) can lead to instability, so accumulators smooth out the update process by aggregating gradient information over multiple steps.

        self._nb_flips = 0    #track the number of flips

    @property
    def nb_flips(self):
        # Return the number of flips and reset the counter
        n = self._nb_flips
        self._nb_flips = 0
        return n

# Loop through each parameter group and update its parameters
    def step(self):
        for param_group in self.param_groups:
            for idx, p in enumerate(param_group['params']):
                self.update(p, param_group, idx)  #Deciding whether to flip or not

    def update(self, param: torch.Tensor, param_group: dict, idx: int):
        # Update the parameter using accumulated gradients and determine which bits to flip
        accum = param_group['accums'][idx] * param_group['accums'][idx] + param_group['lr'] * param.grad.data
        param_group['accums'][idx] = accum


        param_bool = param.data.bool() # Cast param.data to bool to perform XOR logic
        param_to_flip = accum * (2 * param_bool.float() - 1) >= 1         # Determine which bits to flip
        param_bool[param_to_flip] = torch.logical_not(param_bool[param_to_flip])   # Perform the bit flip using logical NOT
        param.data = param_bool.float() # Cast back to float after flipping bits
        param_group['accums'][idx] *= 1 - param_to_flip.float() # Update the accumulators for the bits that were flipped
        param_group['ratios'][idx] = param_to_flip.float().mean()   # Store the ratio of flipped bits
        self._nb_flips += float(param_to_flip.float().sum())   # Count the total number of flipped bits


if __name__ == "__main__":
    model = torch.nn.Linear(3, 2)

    for param in model.parameters():
        param.data = torch.randint(0, 2, param.size()).float()

    optimizer = BooleanOptimizer(model.parameters(), lr= 2.0)  #BooleanOptimizer with a learning rate of 0.1

    input_data = torch.randint(0, 2, (5, 3)).float()
    target = torch.randint(0, 2, (5, 2)).float()

    # loss function (Mean Squared Error)
    loss_fn = torch.nn.MSELoss()
    #loss_fn = torch.nn.BCELoss()


    # training
    for epoch in range(10):
        output = model(input_data)
        loss = loss_fn(output, target) #loss calculation

        optimizer.zero_grad()  #clears the gradients from the previous step
        loss.backward()
        optimizer.step()

        # Print the loss and the number of flips after each epoch
        print(f"Epoch {epoch + 1}: Loss = {loss.item()}, Flips = {optimizer.nb_flips}")

